Now that we’re coming out the other side, slowly easing our way out of hibernation ...we can begin to turn our face towards the sun and give our bodies some much needed Spring nurturing and rejuvenation.

We like to think that we are in control of everything in our lives, and tend to forget our elemental nature and that we are also part of a much larger flow, the universal river of Mother Nature. This river is in continuous movement, flushing away any sign of stagnation. 

If we start listening to nature it can teach us age-old lessons on how to tune into the subtle indicators of  dis-ease in our inner and outer environment. We are our own healers.

Health goes much further than the body, mind and spirit, but also includes the health of our relationships to our surrounding ecosystems; social, political and environmental.

Everything is interconnected 

Unprocessed emotions like grief anger and fear can be digested & transmuted through the transformational fire and the natural cycles of decay & rebirth. 

When everything flows freely - from blood and lymph to water and air - the waste will leave the body as it should, and be recycled back into our environment. 

Start with asking yourself some simple questions... 

🍃How is your soil? 
🍃Are you getting enough water? 🍃🍃Where are your nutrients coming from? 🍃Are you stretching towards the light? 

If not, what is blocking your energy? 

Are you doing Spring cleaning in your garden & home to get energy flowing freely? 

Are you cleansing your precious earth ship ~ body temple too? 
